    const maxNum = 3
const [data, setData] = useState([])
const [num, setNum] = useState(0)
const [result, setResult]=useState()


let arr = []

let summ=data[0]+data[1]+data[2]


const changeEquation = () => {
  arr = []

  for (let i = 0; i < maxNum; i++) {
    arr.push(Math.floor(Math.random() * 99))
    setData([...arr])
    console.log(arr)
  }
  setNum(0)
}



const nextNum = () => {

 num == maxNum- 1 ? alert('vse') :setNum(num + 1)
