}
useEffect(() => {
  changeEquation()
}, [])




const valueBtn = [
  {
    textNext:'Next',
    textChek:'Check',
    textExample:'Next Example'
  }
]


    return (

        <View style={styles.game}>
        <ImageBackground source={bg} style={styles.gamePhoto}>
        <View style={styles.textLevel}>
            <Text style={styles.level}>Easy level</Text>
            <View className="App">
        <Text>{counter === 0 ?  navigation.navigate('Result') : `Timer: ${format(counter)}`}</Text>
      </View>
                   <Image style={styles.plus} source={plus}/>
        </View>
          <View>
              <Text style={styles.second}>seconds left</Text>
              <TextInput type="text" value={summ} style={styles.randomNumber} />

          </View>

                      {
                        num == maxNum + 1? <TextInput type="text" style={styles.randomNumber} /> : <TextInput style={styles.randomNumber} value={data[num]}/>
                      }


            <TouchableOpacity onPress={()=>nextNum()} style={styles.next} 
            // onPress={nextNum}

            >
        <Text style={styles.nextText}>

        {/* {valueBtn.textNext} */}

        {
          num !== maxNum- 1 ? valueBtn[0].textNext : valueBtn[0].textChek


        }


        </Text>
            </TouchableOpacity>

            {/* <TouchableOpacity style={styles.next} 
             onPress={changeEquation}>
             <Text style={styles.nextText}>NEXT Exemple</Text>
            </TouchableOpacity> */}

            </ImageBackground>
        </View>
    )
}
